import React from 'react';
import logo from './logo.svg';
import {Provider,defaultTheme,Grid,View} from '@adobe/react-spectrum';
import './App.css';
import LoginForm from './components/Loginform';

function App() {
  return (
    <div className="App">
      <Provider theme={defaultTheme}>

        <Grid areas={[ 'content']}  
              columns={['1fr', '3fr']}
              rows={['size-1000', 'auto', 'size-1000']}
              gap="size-100" >
          <View borderWidth="thin" borderColor="dark" height="size-5000" width="size-5000"> 
            <LoginForm />
          </View>
        </Grid>

      </Provider>
    </div>
  );
}

export default App;
